INSERT INTO `project` VALUES (1,'2025-02-19 14:11:45.327491','2025-02-19 14:11:45.327491','[{\"start\":1320,\"text\":\"액션 화면을 색칠해요. 짱구야\",\"role\":\"A\"},{\"start\":8710,\"text\":\"짠 이거 받아왔다. 액션 가면이다. 어디서 나셨어요? 액션 마트 갔더니 공짜로 나누어 주더라고.\",\"role\":\"A\"},{\"start\":19790,\"text\":\"아 짱이다. 4장이나 있네. 근데 이거 색을 안 칠했는데요. 엄마 요리처럼 대충 그린 거 아니에요?\",\"role\":\"A\"},{\"start\":28836,\"text\":\"색칠 공부니까 그렇지. 색은 네가 칠하는 거야. 그리고 누가 요리를 대충 한다 그래\",\"role\":\"B\"},{\"start\":34955,\"text\":\"뭐 액션 가면 색칠 공부 알았어 맹구도 데려갈\",\"role\":\"C\"},{\"start\":40270,\"text\":\"그럼 다 같이 철순에서 모이는 거다.\",\"role\":\"A\"},{\"start\":44350,\"text\":\"왜 우리 집으로 모이라고 한 거야?\",\"role\":\"C\"},{\"start\":47398,\"text\":\"괜찮아. 신경 쓰지 않아도 돼. 신경 써야 할 사람은 너잖아. 자 안으로 들어와.\",\"role\":\"A\"},{\"start\":55935,\"text\":\"너희 집 아니거든. 자 자 이거 그리고 난 색출 공부하고 싶지 않단 말이.\",\"role\":\"C\"},{\"start\":64664,\"text\":\"자 철수 꽃 그림 마음에 들어.\",\"role\":\"A\"},{\"start\":70110,\"text\":\"아 그냥 뭐 나쁘지 않은데 나도 한번 칠해볼까? 좋지.\",\"role\":\"C\"},{\"start\":75384,\"text\":\"어머나 색채 공부하게 재밌겠는데 자 주스하고 초콜릿 먹으렴.\",\"role\":\"D\"},{\"start\":81993,\"text\":\"왔다 왔다.\",\"role\":\"A\"},{\"start\":84237,\"text\":\"재미있게들 놀아\",\"role\":\"D\"},{\"start\":85660,\"text\":\"잘 먹겠습니다.\",\"role\":\"A\"},{\"start\":89350,\"text\":\"헬로우 초콜릿 살살 녹는다. 철순의 간식은 뭐니 뭐니 해도 주스랑 비싼 외국 초콜릿이\",\"role\":\"A\"},{\"start\":100513,\"text\":\"이거 외국 초콜릿이야\",\"role\":\"C\"},{\"start\":103304,\"text\":\"맛있다. 초콜릿이 목적이었던 거야. 이제 초콜릿도 먹었으니까 슬슬 시작할까?\",\"role\":\"A\"},{\"start\":113320,\"text\":\"집으로 가자. 색칠 공부 안 해?\",\"role\":\"A\"},{\"start\":124490,\"text\":\"어 짱구야 크.\",\"role\":\"C\"}]','짱구는 못말려 7기 3화 더빙하실 분',5),(2,'2025-02-19 14:34:32.035596','2025-02-19 14:34:32.035596','[{\"start\":319,\"text\":\"안녕 안녕 안녕 안녕 안녕 안녕 안녕 안녕 안녕 안녕.\",\"role\":\"A\"}]','안녕',2),(3,'2025-02-19 14:34:39.927105','2025-02-19 14:34:39.927105','[{\"start\":0,\"text\":\"싸늘하다 가슴에 비수가 날아와 꽂힌다. 하지만 걱정하지 마라. 손은 눈보다 빠르니까 아귀한테 밑에서 한 잠\",\"role\":\"A\"},{\"start\":9565,\"text\":\"정마담도 밑에서 앉아\",\"role\":\"A\"},{\"start\":11399,\"t