어 맹구도 데려갈\",\"role\":\"훈이\"},{\"start\":40270,\"text\":\"그럼 다 같이 철순에서 모이는 거다.\",\"role\":\"짱구\"},{\"start\":44350,\"text\":\"왜 우리 집으로 모이라고 한 거야?\",\"role\":\"훈이\"},{\"start\":47398,\"text\":\"괜찮아. 신경 쓰지 않아도 돼. 신경 써야 할 사람은 너잖아. 자 안으로 들어와.\",\"role\":\"짱구\"},{\"start\":55935,\"text\":\"너희 집 아니거든. 자 자 이거 그리고 난 색출 공부하고 싶지 않단 말이.\",\"role\":\"훈이\"},{\"start\":64664,\"text\":\"자 철수 꽃 그림 마음에 들어.\",\"role\":\"짱구\"},{\"start\":70110,\"text\":\"아 그냥 뭐 나쁘지 않은데 나도 한번 칠해볼까? 좋지.\",\"role\":\"훈이\"},{\"start\":75384,\"text\":\"어머나 색채 공부하게 재밌겠는데 자 주스하고 초콜릿 먹으렴.\",\"role\":\"흰둥이\"},{\"start\":81993,\"text\":\"왔다 왔다.\",\"role\":\"짱구\"},{\"start\":84237,\"text\":\"재미있게들 놀아\",\"role\":\"흰둥이\"},{\"start\":85660,\"text\":\"잘 먹겠습니다.\",\"role\":\"짱구\"},{\"start\":89350,\"text\":\"헬로우 초콜릿 살살 녹는다. 철순의 간식은 뭐니 뭐니 해도 주스랑 비싼 외국 초콜릿이\",\"role\":\"짱구\"},{\"start\":100513,\"text\":\"이거 외국 초콜릿이야\",\"role\":\"훈이\"},{\"start\":103304,\"text\":\"맛있다. 초콜릿이 목적이었던 거야. 이제 초콜릿도 먹었으니까 슬슬 시작할까?\",\"role\":\"짱구\"},{\"start\":113320,\"text\":\"집으로 가자. 색칠 공부 안 해?\",\"role\":\"짱구\"},{\"start\":124490,\"text\":\"어 짱구야 크.\",\"role\":\"훈이\"}]','짱구 7기 13화',5),(14,'2025-02-20 06:11:30.756011','2025-02-20 06:11:30.756011','[]','짱구 7기 13화',5),(15,'2025-02-20 09:10:04.308960','2025-02-20 09:10:04.308960','[{\"start\":0,\"text\":\"됐어 됐어 얘 싸움 좋나 못해 둘이 온 거야 시발 청첩장 주러 왔냐\",\"role\":\"테드창\"},{\"start\":6257,\"text\":\"장사 잘 되나? 뭐가 맛있어 피자집이 10세야 피자가 맛있지 그럼 냉면이 맛있을까? 시간 없어서 본론 동업하자. 치킨\",\"role\":\"B\"},{\"start\":16384,\"text\":\"피자나라 치킨 공조하자고 야 창식아 테드창이라고 개새끼야 그래 창식아 테드 창 아니 창시가 아닌데 왜 테드 창인 거야?\",\"role\":\"B\"},{\"start\":26564,\"text\":\"너 영어 이름 어떻게 짓는지 모르지 내가 중국에서 물건 떼주면 넌 팔고 넌 여기서 윈 난 대륙에서 윈\",\"role\":\"B\"},{\"start\":36030,\"text\":\"내가 또 속아 줘야 되는 거냐 어쩌냐\",\"role\":\"B\"},{\"start\":43740,\"text\":\"저번처럼 소금.\",\"role\":\"테드창\"}]','test',1),(16,'2025-02-20 12:12:26.020881','2025-02-20 12:12:26.020881','[{\"start\":21790,\"text\":\"저희가 아침에 스크롬이라는 걸 하거든요. 시간이 되면 사람들이 자리에 일어나서 이렇게 모여요.\",\"role\":\"B\"},{\"start\":29384,\"text\":\"다 모든 이게 부서별로요. 여기도 동그랗게 사람들이 하나 모이고\",\"role\":\"B\"},{\"start\":33954,\"text\":\"먹으면 저쪽에도 모일 거고 저희도 이렇게 보이거든요. 이게 아침에 이렇게 조회하는 건가요? 맞아요 맞아요. 이 노래가 나와 일어나를 일부러 해놓은 거거든요. 아\",\"role\":\"C\"},{\"start\":44144,\"text\":\"다 일어나라고\",\"role\":\"B\"},{\"start\":46514,\"text\":\"안녕하세요. 반갑습니다. 안녕하세요.\",\"role\":\"A\"},{\"start\":51260,\"text\":\"그래서 이제 아침에 저희가 모여서 그냥 오늘 할 일이나\",\"role\":\"B\"},{\"start\":55540,\"text\":\"특별히 공유할 이슈 같은 게 있으면 그냥 자유롭게 한 명씩 돌아가면서 얘기를 해요. 그래서 이제 스크럼 할 때 누구부터 시작하냐면 제일 마지막에 용사\",\"role\":\"B\"},{\"start\":63599,\"text\":\"저희 팀장님이시고요. 저희 회사는 팀장이 있으신 분 아니에요? 아니\",\"role\":\"B\"},{\"start\":71679,\"text\":\"항상 청바지에 검은 티셔츠를 입는 판교 잡스라고 비와이 닮은 스\",\"role\":\"B\"},{\"start\":77666,\"text\":\"맞아요. 보시는 닮았다고 짤도 있어요. 여기 보시면 머리 뒤에 대 조지\",\"role\":\"A\"},{\"start\":86605,\"text\":\"그럼 조디부터 스크롬 시작하시죠\",\"role\":\"B\"},{\"start\":89399,\"text\":\"저 같은 경우는 지금 좀 전체 이제 유통 플로 정리하는 부분 하나 있고\",\"role\":\"D\"},{\"start\":94660,\"text\":\"그리고 오늘 이제 그 테런이 대표 보고하는 거 있어요. 그래서 그거 같이 좀 준비하는 것들 그리고 나머지는 그냥 면담하고 이런 것들 진행 예정입니다.\",\"role\":\"D\"},{\"start\":107900,\"text\":\"오늘 본인의 할 얘기\",\"role\":\"B\"},{\"start\":110406,\"text\":\"일단은 사실 제가 어떤 일을 하는지는 잘 모르기 때문에 절대 민폐 안 끼치고 세탁 열심히 하도록 열심히 하도록 하겠습니다.\",\"role\":\"C\"},{\"start\":119959,\"text\":\"저는 오늘 보 쪽이랑 그다음에 언어 쪽에 같이 협업할 거 있어서 그 미팅 있고.\",\"role\":\"A\"}]','테스트',2),(17,'2025-02-20 16:25:07.991211','2025-02-20 16:25:07.991211','[{\"start\":0,\"text\":\"싸늘하다 가슴에 비수가 날아와 꽂힌다. 하지만 걱정하지 마라. 손은 눈보다 빠르니까 아귀한테 밑에서 한 잠\",\"role\":\"A\"},{\"start\":9565,\"text\":\"정마담도 밑에서 앉아\",\"role\":\"A\"},{\"start\":11399,\"text\":\"동작금 안 뒷장 빼기냐 뭐야 내 패하고 정마담 패를 밑에서 뺐지. 내가 그 말이 핫바지로 보이나. 이 새끼야 증거 있어 증거 증거 있지.\",\"role\":\"B\"},{\"start\":19725,\"text\":\"너는 나한테 구땡을 줬을 것이여. 그리고 정마담한테 주려는 거 이거 이거 이거 장자리 아니여 정말 이렇게까지 해야 돼\",\"role\":\"B\"},{\"start\":28708,\"text\":\"잠깐 그렇게 피를 봐야겠어\",\"role\":\"C\"},{\"start\":32687,\"text\":\"구라치다 걸리면 피 보는 거 안 배웠냐\",\"role\":\"B\"},{\"start\":38380,\"text\":\"이 폐가 단풍이 아니라는 거에 내 돈 모두하고 내 손모가지 건다. 쫄리면 뒤지시던지 이\"